import React, { Component } from 'react'
import { NavLink,Switch,Route } from 'react-router-dom'
import './index.css'

export default class Frontpage extends Component {
    render() {
        return (
            <div id="totalwrp">
                <div className="linkwrp">
                    <NavLink className="link" activeStyle={{color:'#40A9FF'}} to="/Login">登录</NavLink>
                    <NavLink className="link" activeStyle={{color:'#40A9FF'}} to="/Register">注册</NavLink>
                </div>
                <Switch>
                    <Route path="/Frontpage/Login"></Route>
                    <Route path="/Frontpage/Register"></Route>
                    <Route path="/Frontpage/Lose"></Route>
                </Switch>
            </div>
        )
    }
}
